import React from "react";

const API_IMG = "https://image.tmdb.org/t/p/w500/";

const MovieBox = ({
  titel,
  poster_path,
  vote_average,
  release_date,
  overview,
}) => {
  return (
    <div className="card text-center bg-secendary mb-3">
      <div className="card-body">
      
        <h1>{titel}</h1>
        <img src={API_IMG + poster_path} />
        <p>{overview}</p>
      </div>
    </div>
  );
};

export default MovieBox;
